import { getAllByDisplayValue } from "@testing-library/react";
import axios from "axios";
import React, { Component } from "react";

export default class Login extends Component {

    handleClick() {
        axios.get('http://192.168.50.71:8000/third_party_login?email=' + this.state.email)
        .then((response) => {
        console.log(response.data);
        console.log("Who can it be now?");
        console.log("**SAXAPHONE**")

      });
    }

    render() {
        return (
            <form>
            <h3>Sign In</h3>

            <div className="form-group">
                <label>Email address</label>
                <input type="email" className="form-control" placeholder="Enter email" />
            </div>

            <div className="form-group">
                <label>Password</label>
                <input type="password" className="form-control" placeholder="Enter password" />
            </div>

            <div className="form-group">
                <div className="custom-control custom-checkbox">
                    <input type="checkbox" className="custom-control-input" id="customCheck1" />
                    <label className="custom-control-label" htmlFor="customCheck1">Remember me</label>
                </div>
            </div>

            <button type="submit" className="btn btn-primary btn-block" onClick={this.handleClick} >Submit</button>
            <p className="forgot-password text-right">
                Forgot <a href="/forgot-pass">password?</a>
            </p>
        </form>
        );
    }

}
